    "Notes":"Built as the Second Presbyterian Church in 1834, the building at 101 E. Third Street is a fine example of the Greek temple plan. Its walls and high foundation are of brick, but are stuccoed white and smooth. The inset entry has two simple fluted Doric columns. Five square pilasters flank each side of the entry and continue around the side of the building. It has double wooden entry doors, and two additional doors with upper transom lights lead to anterooms on the sides of the inset porch. The large windows on the sides of the building are twelve over twelve lights. The low-pitched front gable roof creates a pedimented front. Triglyphs and a simple decorative cornice compose the entablature and triangular pediment ."
