    "Notes":"William McClain built the house at 106 E. Third Street in the 1830s. The two-story house has a three bay facade. The foundation has a limestone irregular coursed cladding, a water table, and basement windows on the front facade. The walls are brick common bond. Four limestone steps lead up to the entry, the lowest is a curtail shape. These steps are fitted with facing iron benches. The slightly inset panel door has a multi light upper transom and wood trim detailing. The six over six light windows and door have radiating brick voussoirs, lintels and stone sills. The low pitch side gable roof has parapetted gable ends with corbelling at the facade. The roof is of standing seam metal and has simple bands of wood trim at the frieze. There are double brick chimneys on the east gable side."
