    "Notes":"Solomon Devenish built the rear part of the house at 108 E. Third Street between 1837 and 1839. William Fry built the front section several years later. What resulted is a Federal home with late Classic details. The two-story house is made of brick in common bond pattern. It has a parged rubble stone foundation and a stone water table. The three-bay facade has a modern panel door with a multi light upper transom and shuttered six over six light windows. All openings have a slightly pedimented flat dressed stone lintel and stone sills. The low pitch side gable roof has brick dentils and corbelling at its frieze. The walls of the side gables have parapets."
