    "Notes":"The many Italianate details on the home at 109 W. Third Street were later additions, as it was constructed in 1842 in the Federal style. The two-story home has a rectangular plan and walls of brick common bond. The three bay facade has a modern door with upper transom light in a decorative pedimented surround with dentils and scrolled brackets. The two over two light windows have pressed metal decorative crowns with dentils. A projecting decorative cornice surrounds the low pitch side gable roof; the facade cornice has a saw tooth band of trim at its frieze and scrolled eaves brackets. There are two brick chinmeys on the east gable side."
