    "Notes":"117 W. Main Street is another of Madison's Federal style commercial buildings with Italianate detailing added in the latter 19th century. The brick common bond walls create a side gable profile on the Central Avenue side of the building. The first floor entry of this building has been greatly modified but retains cast iron columns. The fenestration on the second and third floors retains a great deal of integrity. The smaller scale of the two/over/two light windows indicate an early nineteenth century origin, and the later additions of pressed metal projecting hoods belie the Italianate additions. The facade features a wide projecting Italianate cornice decorated with brackets and panels."
