    "Notes":"Historic Madison, Inc. maintains the Greek Revival building at 120 W. Third Street as a museum, displaying the Dr. Hutchings' Office and Hospital of the late 1911 Century. The building, constructed around 1840, has a two-story two-bay brick facade. The sandstone foundation supports common bond brick walls. The panel door has a four-pane upper transom light. The windows are six over six lights, and all openings have flat dressed stone lintels and sills. The gable front roof is medium pitch, and features a wide band of frieze trim on the triangular pediment."
