    "Street Direction":"West",
    "Street":"Main",
    "Street Type":"Street",
    "Notes":"This large Greek Revival home at 1229 W. Main Street was likely built in the 1840s and underwent alterations during the Italianate period.  The square foundation of the 2-story home is of rough dressed limestone, with a few additions of modern parging. The Classic central front and rear porticos have two Ionic columns each and a classic entablature with dentils. The slightly recessed north entry has full transom lights and an ornate wood panel door. Replacement one over one light windows fill the brick segmental arch openings with shutters on the north side, but the south and west sides have smooth limestone lintels and sills with six over six light windows. The walls are of common bond brick and the south facade features four projecting stuccoed pilasters. The low-pitched hipped roof has a small flat deck with an iron balustrade. There is a projecting Italianate cornice with brackets and dentils on two sides and a chimney at each corner of the building."
