    "Notes":"The Federal home at 123 W. Third Street was built in 1843 and later underwent Italianate changes. The three-bay facade of the two-story home shows its Federal origins its fenestration proportions and shapes. The rubble stone foundation is parged and has a stone water table and basement windows on the front facade. The west side of the building has a bi-level porch with wood rails and round columns, the front stoop has iron benches built into its rails. The front upper light carved door has an upper transom and a bracketed full surround. The two over two light double hung windows have only dressed stone sills and shutters. The low-pitched side gable roof has a projecting Italianate cornice with scrolled eaves brackets and a wide frieze band. There is a brick chimney on the west gable end."
