    "Notes":"The Madison State Hospital Power Plant at 1231 W. Main Street is a fine example of a Craftsman style utility building. The State of Indiana constructed the building in 1906-1910 as part of the Madison State Hospital complex nearby . The symmetrical 1-story building faces the street and has a detached smokestack. The foundation is of red brick and there is a limestone water table. The walls are of red and tan bricks and have quoins of limestone. Arched multi-pane windows flank the central double door entry with upper transom light under a round limestone-accented arch. Three segmental arched twelve over twelve light windows with radiating brick voussoirs face the front on each side wing. The cross-hipped roof is of red architectural tile, has overhanging eaves, and features a central cupola."
