    "Street Direction":"",
    "Street":"Broadway",
    "Street Type":"Street",
    "Notes":"The Broadway High School at 124 Broadway Street was constructed in 1928 utilizing the Classical Revival style, a favorite of early 20th century Beaux Arts architectural schools. The large rectangular 3-story building sits upon a concrete foundation that is flushed with the ground on the north end but raised five feet on the south side, evidence of the changing elevation. Walls are of brick in the stretcher bond pattern and feature many decorative pilasters, limestone accents, stringcourses and varied brickwork. The central bay has a slightly protruding pediment with decorative swags and a facing of decorative carved limestone. Three sets of paired multi light doors with upper transoms are set into a grand segmental arch opening. Windows throughout are paired one/over/one light with a three part upper light\nand stone sills. The flat roof has a raised decorative parapet with concrete swat panels and various modillions."
