    "Notes":"The commercial building at 201-205 W. Mam Street is similar in many ways to its neighbors at 207 and 209 W. Main. It was also constructed as early as 1830 and has later Italianate details. This building is divided into two storefronts; the main entry to one is on a mitered comer identical to the Collins building at the other end of this block. This entry has double leaf doors and transom light. Both storefronts have full display windows with nice iron front details. Windows above are either six/over/six or modern one/over/one lights with flat dressed stone lintels and sills. The high side gable profile of the roof speaks to its early nineteenth century origins. The front facade has a decorative Italianate cornice identical to that at neighboring 207 W. Main."
