    "Street":"Broadway",
    "Street Type":"Street",
    "Notes":"An architect by the name of Humes designed the Madison Presbyterian Church at 202 Broadway in 1848. The Greek Revival building has a front facing pediment broken by a slightly projecting three-part bell tower. The rectangular building sits upon a very high foundation and has walls of common bond brick. These walls have simple pediments spaced at intervals around the building. Paired panel pocket doors at the top of the entry staircase open to reveal multipane window doors, both surrounded by a simple wooden surround. Windows at the second floor sanctuary are stained glass, but were originally clear glass. These openings have simple flat lintels and sills. The front gable roof has a simple cornice surround. The central bell tower that disrupts the facade is comprised of three parts, each set back from its base. A bell shaped roof with some denticulated decoration tops this tower. The building has a one story modern addition to its north side."
