    "Notes":"The two-story Italianate home at 204 W. Third Street was originally constructed as a duplex around 1890, but the owners now use it as a single-family home. The rectangular plan sits on a foundation of coursed, rough-dressed stone. The walls are of brick, laid in an unusual stretcher bond pattern with randomly placed headers. The two paneled doors on the four bay facade have upper transom lights and are slightly recessed; all the windows and doors on the facade have flat dressed stone lintels and sills. Windows on the sides are set in brick segmental arch openings. The medium pitched hipped roof is a cross gable and has a wide cornice decorated with a saw tooth band of trim and eaves brackets"
