    "Notes":"John Coates built the Italianate house at 212 W. Second Street sometime between 1868 and 1874. The house sits on a rubble stone foundation and has brick walls laid in common bond pattern. The slightly recessed main door has double pointed arch paneling, sidelights and a denticulated cornice with brackets. The two/over/two light windows are set into segmental arch openings and have pressed metal decorative hoods that conform to their shape. The medium pitch, side gable roof has a wide, projecting cornice with paired Italianate brackets and modillions. There are three brick chimneys on the west gable. The house has a brick carriage house on the rear alley."
