    "Notes":"The building at 227 E Main Street was constructed as early as 1830.  It is one of four buildings located on the Bierck-Heuse Block. Others are 223, 225 and 229 E Main Street.  Even though previous records state construction dates in the 1880s, there is interior  evidence that at least the building at number 227 was built in the 1830s. For example, the building seems to have been shorter, but  added on to at a later date. Not only that, the outline of the former roof on 227 can be seen from the third floor of 225. It was originally a low pitch side gable, which suggests an older date. In each, the first floor was originally one long narrow room used for retail business. The other buildings also appear to date earlier than the front facades. These buildings were remodeled ca. 1880 for Peter Bierck and Otto Reuse as a continuous block of four storefronts.  All four buildings were unified with new Italianate windows, facades, cornices and ground floor iron fronts.  The store front of 227 E. Main St. is iron, in excellent condition, with Corinthian columns. The upper light door has a blocked upper transom and sidelights.  Windows are two/over/two lights with pressed metal hoods. The building is topped by a shed roof with projecting cornice, decorative eaves, brackets and panel.  It  has a rectangular plan with walls clad in brick laid in a common bond"
