    "Notes":"Architect David Dubach designed and built the Jefferson County Courthouse in 1854 after an 1853 fire destroyed the original courthouse. This building, an example of Greek and Roman design influence, is located at the corner of Jefferson and Main Streets. The high foundation of the rectangular building is of limestone mined from nearby Marble Hill.  The stone has a draft line which has been crandalled with a masonry tool of the same name, a decorative treatment found in better quality work.  The west facade has a second level portico with Ionic fluted columns and decorative pediment; one enters the building through three round arch openings under the floor of the porch. There are nine elongated windows on the north and south facades, three on each the east and west. These windows are nine/over/nine pane, have partial pedimented dressed stone surrounds, carved stone crowns, and are separated by pilasters with classic capitals. The cross gable roof has a classically detailed pediment at each of the four gable ends. A central cupola with four clock faces and a domed top surmounts the building."
