    "Street":"Walnut",
    "Street Type":"Street",
    "Notes":"The Queen Anne style home at 301 Walnut Street was constructed around 1890. It sits at the comer of Walnut and Second Street and features a prominent tower at the comer. Its irregular plan sits on a high coursed rough-face stone foundation. Walls are a composite of brickwork, wood shingles, and modem aluminum siding. The porch on the first floor of the round corner tower is enclosed. Various windows are found on the house. A near-Palladian style window with intricate column details is on the east facade. Below it is a segmental arch composite windows with a limestone lintels and keystone with metal embossed details. The steep pitched roof is cross-gabled, with a saw tooth band of trim under the wide eaves. These eaves return at the gable ends. The tower has a conical roof with a decorative finial and embossed metal trim. The south gable end has a large decorative gable vent."
