    "Notes":"The Talbott House at 301 W. Second Street is another of Madison's earliest Federal homes. Richard C. A. Talbot constructed a segment of this house earlier than 1819 in a newly plotted portion of Madison. The two story, five bay facade home sits high on a three foot parged foundation. Its brick walls are laid in a Flemish bond pattern. The central front entry is a Victorian-era leaded glass inset door with a bracketed flat hood. The six/over/six light windows have radiating brick voussoirs, dressed stone sills, and shutters. There is a recessed upper light door on the east side with an upper transom light. The side gable roof is medium pitched, with gable end chimneys on either side. The cornice has brick corbelling and a plain board for trim on the gable ends. There are brick and stone steps with iron railings on both the front and side entrances as well as a bi-level porch on the rear extension."
