    "Street":"Jefferson",
    "Street Type":"Street",
    "Notes":"The Federal commercial building at 308 and 310 Jefferson Street are another example of Madison's earliest building style. This row of two-story building dates at least to the early 1820s, with few changes to the present day. The lots were purchased by the Farmers and Mechanics Bank in 1817. The buildings may have been built at this time or thereafter. Their brick walls are laid in the Flemish bond pattern and they rest on dressed sandstone foundations. 308 Jefferson features a slightly recessed full light door with side and upper transom lights. It has replacement one/over/one windows in the original wood openings with shutter hardware. A simple wood signboard runs above the first floor openings. 310 Jefferson has a recessed full light door. Like 308, it has wood sills and a wood signboard. Both buildings are side gabled standing seam metal roofs with a parapet wall between buildings. Their front facades have brick corbelling and dentils at the cornice."
