    "latitude":38.736166,
    "longitude":-85.383472,
    "Street Number":"315",
    "Modifier":"",
    "Street Direction":"",
    "Street":"Broadway",
    "Street Type":"Street",
    "Notes":"The Broadway Hotel and Tavern at 313-317 Broadway is a large cluster of buildings with various construction dates. As early as 1825, the southern part of the building was constructed. The Italianate period mitered comer at the north side indicates that the building was reconfigured in the 1870s. The three-story building sits on a brick foundation and has brick common bond walls. The entry to the southern portion of the building is an upper light panel door with full transom. The entry at the northeast corner of the building sits in a Madison Machine Company metal chamfered corner piece similar to those found throughout Madison. Yet another front entry has a projecting Italianate cornice. The roof is a medium pitched side gable with a wide projecting Italianate cornice. This cornice has scrolled brackets, panels, dentils, and other pendant-type decoration."
