    "Street Type":"Street",
    "Notes":"Built as early as 1823, the Federal home at 315 E. Second Street is notable for its unusual Classic style entry. A Madison furniture maker, David Wilson, built the two-story home. The Wilson house sits on a rubble stone foundation with rough dressed and coursed stones at the front facade. Its walls are brick laid in the common bond pattern. The notable entry features a frame with a half circle stone hood above an arched upper transom light. There are small inset Doric columns on each side of the recessed upper light modern door. Replacement windows on the home are set into openings with flat dressed stone lintels and sills. The side gabled roof has a gable end chimney and a front cornice with a plain band of wood trim. On the east side there is bi-level gallery porch."
