    "Street":"Walnut",
    "Street Type":"Street",
    "Notes":"The ca. 1840 home at 316 Walnut Street is a great example of the simplistic Federal style. The two-story rectangular house sits on a stone foundation with a stone water table. Its walls are laid in the brick Flemish bond pattern. It has a panel door with an upper transom light and six/over/six double hung windows set into openings with stone sills. Side windows also have radiating brick voussoirs. The roof is a side gabled of low pitch. Typical of the style, rising above the south side is a parapetted gable end chimney."
