    "Notes":"The Italianate home at 317 W. Third Street, and its twin at 315, was constructed around 1850. The two story homes which mirror each other, are rectangular in plan and share a party wall. Their rubble stone foundations support walls of brick in common bond pattern. Each has a bi-level porch on its outward facing side. The slightly recessed entry at 317 has a segmental arch upper light carved panel door with an upper transom light. Its shuttered windows are six over six light and have flat dressed stone lintels and sills. The low pitch side gable roof has a projecting cornice with scrolled brackets."
