    "Modifier":"",
    "Street Direction":"East",
    "Street":"Main",
    "Street Type":"Street",
    "Notes":"On the same block as the Jefferson County Courthouse is the Jefferson County Jail. This building is also in the Greek Revival style and was built for the county in 1849. The two story rectangular building was built of stone from a quarry in Jennings County. The building received a major addition to its eastern side in 1973 that altered the building greatly, but did not destroy the integrity of the original. The original portion of the building had a large front gable classic pediment. The deeply recessed central entry has a wide classical surround with dentils and decorative molding. There were five bays of six/over/six pane windows on the building, each with flat stone lintels and sills. The cellblock has walls four foot thick and a vaulted ceiling."
