    "Street":"Jefferson",
    "Street Type":"Street",
    "Notes":"The Knights of Pythias built the Romanesque style building at 318 Jefferson Street. The lodge built it to allow space for commercial activity below their meeting hall above. The four-story building projects a rustic turret at its northwest corner and has walls of brick stretcher bond with limestone details. The ground floor has commercial glass display windows and a modern double door. Above this entry is a limestone arch surround. Windows on the street facade are one/over/one with limestone lintels and sills. Along the side of the building, some windows are paired into arched openings with upper transom. The tower has limestone belt courses and heave stone lintels over the windows . At its top is decorative stone corbelling. It has a flat roof with tile coping atop the parapetted edges. A shed roofed brick carriage house of approximately the same date is also located on the property."
