    "Notes":"The two-story building at 320 Central Avenue is outstanding for its intact details of the Italianate style. Likely constructed around 1890, the building sits on a rubble stone foundation with stone facing and water table. Its brick walls are laid in Flemish and common bond patterns. The four bay facade has one/over/one pane replacement windows set in elongated openings with bracketed pressed metal crowns. The large upper light door has a large upper transom and a flared roof bracketed hood. Windows on the sides of the building are six/over/six and are set into openings with flat stone lintels or brick segmental arches. On the southern side, there is a double full light commercial door with a dual upper transom light set into a segmental arch. The roof is a low grade shed style with a projecting Italianate cornice with pressed metal dentils, brackets, and arched panels on the front."
