    "Street Type":"Drive",
    "Notes":"The Crystal Beach Swimming Pool on the 400 W. Block of Vaughn Drive was constructed in 1938 as a W.P.A. project. The stone building and pool are typical of the period's popular Craftsman style. The two story rectangular building, approximately 40 by 105 feet, sits on a stone foundation, its walls are of irregular rough-cut ashlar stone. A full front porch with stone columns and an upper balcony of wood dominates the facade. Its main entrance is into an open central passage, closed seasonally by a modem garage style door. Windows of the building are square and double hung. The roof is a gable on hip style with expressed rafters under the very wide eaves. The pool is semicircular in shape and surrounded by a lawn with trees. A chain link fence sits atop a stone wall matching the building's materials."
