    "Street Type":"Street",
    "Notes":"The large three-story federal style building at 402 E. Main Street was constructed as the Indian Kentuck Hotel in 1851. Though parged, the original stone foundation is visible. The walls are of brick laid in a common bond pattern. The three bay facade of the building has large commercial pane windows that may be originals. There is a central double leaf door with transom light flanked by the two four pane display windows also with upper transom light and lower wood panel. There is an identical window on the Walnut Street side, continuing the pattern of display windows surmounted by a stone band around the corner. Second and third story windows are six/over/six lights with pedimented dressed stone lintels and flat sills. The hipped roof has a medium pitch and closed eaves. A row of brick dentils decorates the cornice. Several brick chimneys remain on the Walnut Street side of the building."
