    "Notes":"Built around 1860, the home at 405 W. Third Street is a fine example of the Italianate style. It is a two-story home, has a rectangular plan and a three bay facade. The impressive entry has a modern carved panel door with an upper transom light. The door and the shuttered  four over four windows are in segmental arch openings with wooden decorative hoods with labels. The low-pitched side gable roof has a projecting decorative cornice with eaves brackets. The west side has a gable end brick chimney. A period cast and wrought iron fence with multiple highly detailed gates surrounds the yard."
