    "Street":"Mulberry",
    "Street Type":"Street",
    "Notes":"The Odd Fellows of Madison built a fine example of a Classical Revival commercial building at 408-418 Mulberry Street. Constructed in 1911, this building has a meeting hall on its second floor, but offers a row of commercial fronts along the street. The two-story building sits upon a rectangular limestone foundation and has walls of light brick and limestone. The street facade is divided into five bays by nearly flush pilasters with simple capitals. Four of these bays feature a full light door with upper transom flanked by commercial glass windows above panels. Each of these is topped by an aluminum awning and has a large composite window with limestone sills on the second story. The southernmost bay has a recessed double upper light door that accesses the upstairs meeting hall. The building's roof is flat and concealed behind a raised parapet with limestone coping, brick corbelling, and limestone belt course at the cornice."
