    "Street Type":"Street",
    "Notes":"St. Mary's Catholic Church was built in 1851 at 413 E. Second Street in a Gothic Revival style. The ground underneath the church slopes very slightly to the south, toward the Ohio River. A paved parking lot to the east abuts the building, while wide stone steps lead from the sidewalk on Second Street to the front entry. The iron fence is Stribling (see architectural description 3-397) cast iron and runs around the front gardens and up stairs as a railing.  Small trees and bushes grow in front of the church and two lampposts protrude from the sidewalk. St. Mary's church is three stories, excluding the tower, and was built in a rectangular plan with a dressed, coursed stone foundation. Double arched panel doors open onto Second Street with a stained glass upper transom fit into pointed arch surround. Pointed arch stained glass windows with stone sills and brick surround peer from the front and the side of the church. The roof is a front gable low pitch with overhanging and boxed eaves. The steeple is square with brick decorative work and a rose window. An octagonal bell chamber extends above with decorative gables, a conical roof and a steeple."
