    "Street Type":"Street",
    "Notes":"The square plan building at 416 West Street was the former site of the Madison City Hall. Built ca. 1870, the building was originally Italianate in style, as seen by the window treatments on the north and south facades. Around 1925, the building received a Neoclassic facing. The two story cubic form sits upon a foundation with stone facing. The brick walls are both common and stretcher bonds, reflecting the varied construction dates. The facade of the building features three wide bays. There is a central recessed entry with double wood full light doors and upper transom light. This entry is in a projecting arched opening with a flat roof and many classic stone details. The windows are tripartite with a flared stone lintel with keystone and stone sills. Italianate windows on the north and south sides are four/over/four panes with pierced metal crowns and stone sills. The hipped roof has a wide cornice surround of  pierced metal decorated with brackets and varied panels."
