    "Street":"Broadway",
    "Street Type":"Street",
    "Notes":"The home at 419 Broadway takes the name \"Eggleston House\" because it was the home of author Edward Eggleston between 1891 and 1902. Madison founder John Paul constructed the Federal/Italianate house, however, earlier than 1834. The rectangular main block of the home has extensions that stretch to the rear alley, from here it continues along the rear alley so that all original outbuildings are connected to the main block. The house sits on a brick foundation and has brick walls laid in Flemish bond on the front and common bond on the sides. The notable front porch has a wood denticulated cornice with wrought iron supports. Windows on the facade are all two/over/two with projecting bracketed heads. Other windows throughout the house are six/over/six or nine/over/nine. The main door\nhas a transom with a basket handle arch upper light. The main body of the house is side gabled with a decorative Italianate cornice on all sides. This cornice has saw tooth band projecting molding and on the facade features paired scroll-cut brackets. The roof is of standing seam metal."
