    "Street Direction":"",
    "Street":"Mulberry",
    "Street Type":"Street",
    "Notes":"James McKee originally owned the 1832 Federal home at 428 Mulberry Street built by Madison architect-builder, Mathew Temperly. The rectangular home abuts the sidewalk on two of its sides, sits upon a foundation of rough dressed and coursed stone, and has walls laid in brick Flemish bond. It has a five bay facade on the Mulberry Street side. At center of this facade is a recessed wood panel door with side and upper transom lights flanked by fluted columns and a classical surround. The windows are six/over/six with flat dressed stone lintels and sills. The panel fills with iron grates on the front are an early twentieth-century addition. The side gable roof has parapetted gable end chimneys, brick corbelling, and dentils at the front facade. The building originally had a bi-level porch on the south side, but the upper story has since been blocked. The front porch is a sandstone and limestone stoop with iron rails ."
