    "Street":"Broadway",
    "Street Type":"Street",
    "Notes":"The Broadway rowhouses at 503-509, notably those at 507 and 509, are fine examples of the Federal rowhouse style. The houses were built in the 1830s and retain many of the stylistic elements of that time, but reflect subsequent remodeling through some Italianate detailing. An arched walkway under their party wall separates the southernmost two houses. The two story homes all sit on a rough dressed, coursed stone foundation. The walls are brick laid in the Flemish bond style. Each of the four homes has a front stoop only. No. 507 features two/over/two pane windows and entry door with projecting Italianate bracketed hoods. Its entry door has two arched upper lights. House 509 has one/over/one pane replacement windows with dressed stone lintels and sills. Its main door has an upper transom  and a stone lintel. The roofs of the rowhouses are all side gabled with a relatively high pitch. 505 has a brick parapet and dentils at its front fac;ade while 503, 507, and 509 each has a projecting Italianate bracketed cornice detailed with dentils and gothic arches. Several of the roofs have slate covering."
