    "Street":"Jefferson",
    "Street Type":"Street",
    "Notes":"The two-story Federal rowhouse at 508 Jefferson Street is similar to many of its neighbors in retaining its original character. Its foundation has a limestone casing and water table and its brick walls are in a Flemish bond variant. Along the side to the rear is a bi-level porch with turned wood railings, with only a sandstone stoop on the front. This home has notably large two/over/two windows on its side, along with a large door with double arched upper lights. The front entry is a slightly recessed carved panel upper light door. The windows on the facade are one/over/one with flat dressed stone lintels and sills. It has a side gable roof with a wide projecting Italianate cornice that returns on the gable ends. This cornice features decorative scrolled brackets."
