    "Notes":"The home at 510 Jefferson Street was constructed as a federal rowhouse around 1830 and later received Italianate detailing. The three bay side gable home sits abutted to the sidewalk on its urban lot. The brick walls are laid in a Flemish bond pattern. The front entry is a slightly recessed upper light door with an upper transom light, approached by a stone stoop. The windows on the front facade all have six/over/six lights and wooden sills. Some side windows have nine/over/six lights. The medium pitch roof has a wide, projecting Italianate cornice decorated by scrolled brackets. There is a gable-end brick chimney on the north side."
