    "Notes":"The 1849 Alfred Dunning House at 511 Broadway is another of Madison's spectacular Federal rowhouses with later Italianate additions. This two-story home sits on a stone foundation with basement windows, limestone facing, and a water table at the front facade. The  home has a three bay front, walls composed of brick common bond, and a bi-level porch inset into its southern side. This home retains six/over/six pane windows with flat dressed stone lintels and sills. Its main door has an upper transom light and the same flat dressed stone lintel as the facade windows. The side gabled roof is medium pitch and has an ornate cornice surround. The projecting front of this Italianate cornice features gothic style arches, dentils, and brackets."
