    "Notes":"An excellent example of Italianate architecture is located at 512 East Main. The three story five bay house was constructed in 1871-1872 and is an imposing statement in the streetscape. The house is situated on a raised foundation of limestone with large basement windows. The common bond brick walls support a heavy ornate roof cornice. The roof cornice has large brackets that extend down past the cornice board and also incorporate the attic windows on the third floor. Large ornate pressed metal window hoods adorn all of the two/over/two light windows. A center portion of the facade projects forward from the rest of the facade and extends the full height of the facade. The central portion incorporates the main entry of the house. Which has a bracketed surround of pressed metal. The doorway is surmounted by a semicircular arch that also houses a similar transom. Located above the entry is an ornate cast iron balcony."
