    "Notes":"The Queen Anne style home at 523 Jefferson is one of the few of its style in Madison. This home sits upon a three-foot bluff of land and was likely constructed around the turn of the century. Its walls and foundation are cast concrete block: that and the irregular plan are typical of the period. Beneath its flat roof porch with Tuscan columns is the upper light panel door with composite decorative pane windows. The front of the home features a bay projection with one/over/one pane windows. The roof of the home is a very high pitch hip-on-gable. Each gable end features varied decorative shingles, decorative bargeboards, and diamond pane windows, some with lintels and sills. There is a central brick chimney. A rough cut coursed stone retaining wall that has a wood arched door leading to the basement level of the home encircles the yard."
