    "latitude":38.741127,
    "longitude":-85.38739,
    "Street Number":"600",
    "Modifier":"",
    "Street Direction":"West",
    "Street":"5th",
    "Street Type":"Street",
    "Notes":"Springdale Cemetery is a classic, linear plan landscape in the mode of the garden cemeteries which became popular during the nineteenth century. Mt. Auburn Cemetery in Boston pioneered the movement early in the century and many others followed. Springdale is set in a small protected valley at the north side of Madison, with Crooked Creek as its southern boundary, and the base of the hill as its northern boundary. Today, State highway 7 has cut off the original entry, although the land and burials have remained intact. Entrance to the cemetery is now from the east and visitors travel down the main road from east to west, with secondary roads branching off in a rectilinear pattern.  The grounds are punctuated by several stone lined drainage ditches running in a north/south direction, probably dating from the middle of the nineteenth century. Sections of the cemetery are highlighted by tall sculpture and decorative markers, including a number of obelisks and other styles. Several family plots are located, European style, in terraces up the hill - some with rock faced stone retaining walls. There is a spectacular sculpture, \"Let there be Light'', by the nationally known artist George Grey Barnard. Only a few buildings are included on the site. One, a gable front residence serves as an office and was probably incorporated into the cemetery during a period of expansion.  A second building is a Gothic Revival chapel constructed in 1916 and designed by the architect Frederick Wallick who designed a large number of important houses in Indianapolis, including \"Oldfields\" (for the Lilly family), \"Lanesend\" for Nicholas H. Noyes and \"Westerley\", the G. H. A. Clowes house, as well as the Polk Hotel, in Polk County, Florida, and the Joseph J. Cole house in Indianapolis.   The latter two are both listed in the National Register of Historic Places. Wallick's chapel in Springdale is constructed of dressed stone with imitation quoins, corner buttresses, stained glass windows and a gable front roof with crockets, and a raised parapet with dressed coping. One object, one building and the landscape (site) are contained within this property. The building at 600 Fifth Street is also within the cemetery. However, it has been listed individually. Springdale Cemetery is shown on maps 2, 3 and 4."
