    "Street":"Broadway",
    "Street Type":"Street",
    "Notes":"The Federal/Italianate house at 609 Broadway was likely constructed around 1840 and received changes in the latter part of the nineteenth century. The two-story building sits on a rise of land atop a dressed stone foundation. It has brick walls and a bi-level inset porch on its north side. Most of its windows are replacement one/over/one pane, but they are in original openings with stone sills and ornate projecting hoods that include dentils and small brackets. The slightly recessed main entry has a door with two upper arched lights with panels below. This door has a classical surround with a large upper cornice and side pilasters. The side gabled roof has a projecting Italianate cornice on the front facade with an applique decorative motif and scrolled brackets. This house retains several of its outbuildings, including two brick carriage houses ca. 1890."
