    "Notes":"The J. Vail-Edwards House at 620 W. Second Street is a beautiful example of a shotgun style house. The one story long rectangular building was built of brick around 1839. The foundation is not visible, but a stone water table surrounds the home. Original openings with wood panels contain its six/over/six light windows. The narrow two bay front facade has crowns and metal canopies with cast iron supports atop each window. Side windows are set into openings of segmental arch brick. The standing seam metal front gable roof has a medium pitch. A scroll cut decorative bargeboard ornaments the front."
