    "Notes":"An example of Italianate style architecture, this house located at 620 W. Main was constructed between 1848 - 1858. The three bay two-story home has a dressed stone foundation that supports common bond brick pattern walls. An elaborate Italianate cornice boasts brackets and dentils. The house has six /over/ six windows that are topped with finely carved limestone window hoods. The windows on the  first floor of the facade extend to the floor and offer entry to the porch. A large ornate decorative cast-iron front porch spans the entire first floor of the facade of the house. This ornate porch has detailed filigree brackets, railings, posts and delicate roof cresting. Two additional cast iron porches recessed and located on each side of the facade offer entry doors into the house."
