    "Street":"West",
    "Street Type":"Street",
    "Notes":"The building at 624 West Street is known historically as the John Dittgen Grocery. The two story Italianate building has an unusual facade of varied arched elements. It was likely constructed around 1850 and received Italianate updates in the latter part of that century. The rectangular building's foundation is of sandstone and rubble stone supporting walls of brick in the common bond pattern. The facade has three bays of arched openings. The right and left openings have upper light doors with fanlight transoms above. The central, wider opening has an unusual five/over/one commercial pane glass window. Above these three arches are three arched openings with two/over/two light windows. All have flat stone sills. Side openings are four/over/four pane segmental arch openings. The front gable standing seam metal roof has a central arched vertical projection on the front facade. Within this arched area is a circular window. Italianate brackets support the overhanging eaves and wide gutters that surround the building."
