    "Street":"2nd",
    "Street Type":"Street",
    "Notes":"The Stribling House, at 625 W. Second Street, was built circa 1840, but underwent significant remodeling by Uriah Stribling in the 1870s. He was a partner in Cobb, Stribling & Company Iron Foundry and also patented a self-supporting fence exampled in his yard and nearby at 618 W. Second Street. His two-story Italianate building stands on flat ground with an irregular plan and a concrete parged, sandstone water table foundation. The Stribling House is aligned with the street and a concrete path runs from the front entry then around the building, past a large yard.  The roof has a front gable of medium pitch, projecting bracketed cornice and wide returns. There is a parapetted roof on the side extensions. Most windows are four/over/six lights, but three round windows form a v-shape at the top of the building with one in the top, center of the building and two on the sides, several feet lower."
