    "Notes":"The Italianate home at 704 W. Second Street was built for Robert McKim, local merchant, around 1870. The symmetrical three bay brick home features a prominent cross gable on its front section. A one-story full width porch has various wood spindles, columns, and decorative items. Double main entry doors have arched glass upper lights. Four over four light windows are set into openings with lipped lintels and stone sills. The third story under each gable has an arched window and there is a bay window on one side. The low-pitched  roof has a decorative Italianate bracketed cornice with returns at gable ends."
