    "Street Type":"Street",
    "Notes":"The large house at 705 W. Second Street is a good example of the late Italianate style. Constructed before 1870, it is a two story square form. The foundation is parged and the walls are of common bond brick. The deeply recessed entry has double outer doors, creating a vestibule. The outer doors are arched and deeply paneled and open to reveal inner doors with sidelights and decorative frosted glass. The windows have four over four lights and are set in segmental arches with ornamental hoods and stone sills. The hipped roof is very low pitched, appearing flat from the road. There is a highly decorative Italianate cornice with alternating brackets and floral medallions."
