    "Notes":"Thomas Godman, pork packer, built the Classical Revival home at 707 W. Second Street between 1853 and 1857. The home has a three-bay balanced facade and is cubic in form. The walls are common bond brick. The recessed entry has artistic upper light glass and sidelights with a dentilled cornice surround. Replacement windows fill the floor length shuttered openings that have flat dressed partial pediment stone lintels and sills. There is a two-story bay window on the east side. The low-pitched side gable roof has a decorative Italianate cornice that was added at a later date."
