    "Notes":"A series of three handsome rowhouses located at 710,712,714 was constructed in the late 1830's of rubble stone and mortar. Each of the three houses are two-story and have three bays. The rubble stone construction has a stucco finish that is tooled to represent mortar joints. This technique obviously was intended to imitate the more costly appearance of finished cut stone. A projecting band located between  the first and second floor runs across all of the three facades. All of the houses have a paneled, recessed main entry with a transom."
