    "Notes":"J. F. Bruning originally built the Gothic Revival carriage house presently located at 717 W. Main Street to accompany a home on the north side of Main Street. This two-story brick carriage house has many decorative touches and was likely constructed around 1870. The roman arched carriage and hay doors are set in brick arches and have heavy X-shaped supports with chamfered edges. Similar personnel doors have upper transom lights in segmental arch openings. The hipped cross gable slate roof has very decorative bargeboards, finials, and trusses. A square high-pitched roof cupola is at center, also with a finial and decorative slate roofing."
