    "Notes":"The Miller Wagon Manufacturing Shop at 805-809 Walnut Street was constructed in 1871. The Italianate building is marked by a series of six Roman arch openings on its street facade. The openings alternate in width, the widest three having double doors. Each arch has a projecting row of bricks as a crown above. Multipane doors or windows fill each opening, and each fills the transom above with a multipane transom. Above each arch is a set of six/over/six double-hung windows paired into a segmental arch surround. The roof slopes to the rear and has a heavily bracketed projecting Italianate cornice. The building has a rubble stone foundation and brick walls in a variant of the Flemish bond pattern."
