    "Notes":"Many of the stone curbs and gutters in Madison have survived from as early as ca. 1850. They can be found on the north-south streets, especially in the oldest parts of the historic district. A typical example of a full stone gutter can be seen on Elm Street adjacent to the Lanier Mansion.  Hard limestone, or calcite, rough dressed, is laid on end to form the edge curbs, while slabs of the same stone are buried, perpendicular to the edge curbs, to form the center of the guttering. Other types, which may date later, utilize large, dressed stone as curbs only. Although they exist at many locations around town and with some variety, the stone curbs and gutters of Madison have been counted as one resource (structure)."
